DROP TABLE IF EXISTS `account_payments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `account_payments` (
  `payment_id` int(11) NOT NULL AUTO_INCREMENT,
  `account_id` int(11) NOT NULL,
  `plan_id` int(11) NOT NULL,
  `date_emission` date DEFAULT NULL,
  `date_due` date DEFAULT NULL COMMENT 'Data de vencimento da fatura',
  `date_payment` date DEFAULT NULL COMMENT 'Data de quando foi pago',
  `date_payment_valid` date DEFAULT NULL COMMENT 'Data de até quando vale o pagamento',
  `status` varchar(15) NOT NULL DEFAULT 'wait payment',
  `value` decimal(10,2) NOT NULL COMMENT 'Valor pago',
  `form_of_payment` varchar(20) NOT NULL COMMENT 'Forma de pagamento',
  `gateway` varchar(20) NOT NULL COMMENT 'Geralmente: "gerencianet"',
  `gateway_code` varchar(100) NOT NULL,
  `resume` varchar(100) NOT NULL COMMENT 'Descrição suscinta do pagamento',
  `description` varchar(255) NOT NULL COMMENT 'Se necessário, descrição mais detalhada do pagamento.',
  `billet_url` varchar(300) DEFAULT NULL COMMENT 'Endereço para visualização do boleto.',
  PRIMARY KEY (`payment_id`),
  KEY `account_id` (`account_id`),
  CONSTRAINT `account_payments_ibfk_3` FOREIGN KEY (`account_id`) REFERENCES `account` (`account_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=292 DEFAULT CHARSET=utf8;
